Before modifying your code, make sure you know of those useful methods when working with mutable references. The problem here is that when you get lent a mutable reference onto an object, you cannot easily become the owner of the referenced object as the reference would not designate a valid object anymore. However, you can: Use core::mem::swap() to exchange the object with another object you own of the same type. This way, the reference stays valid as it points onto another object now. Use Option::take() when you want to take the content of an Option<T> that you do not own, this will replace it by None which is a valid object. core::mem::swap() When a et b are mutable references of the same type &mut T, core::mem::swap(a, b) will exchange the content of a and b. This is a great way to exchange something contained in a mutable reference with something we own locally: type LargeArray = [u8; 1000]; fn exchange(a: &mut Box<LargeArray>) { // How can we become owner of the `Box<LargeArray>` referenced by `a`? // We can exchange it with another object of the same type. // Let's create one. let mut b: Box<LargeArray> = Box::new([42; 1000]); // Let's exchange the object we own in `b` by the one referenced by `a` // (both objects are of type `Box<Image>`). core::mem::swap(a, &mut b); // We now own in `b` the Box<LargeArray> that was in `a`, // and `a` now contains the Box<LargeArray> that was in `b`. // We exchanged the boxes (pointers), the `LargeArray` arrays // themselves were not moved around. // At the end of this function, `b` will be dropped, so the `LargeArray` // which was initially passed in `a` will be deallocated (because the // destructor of `Box` deallocates its content).
} fn main() { let mut a: Box<LargeArray> = Box::new([10; 1000]); println!("a[0] = {}", a[0]); // Will print 10 exchange(&mut a); println!("a[0] = {}", a[0]); // Will print 42
} Note that there is nothing unsafe in doing that. Option::take() When opt is a mutable reference of type &mut Option<T>, opt.take() returns the content of opt and replaces it by None: fn display_option(opt: &mut Option<&str>) { if let Some(s) = opt.take() { // Take the String if any and put None into opt println!("I have taken ownership of the string, which was: {s}"); } else { println!("There was nothing in the opt"); }
} fn main() { let mut opt = Some("Hello, world"); display_option(&mut opt); // Will display the string and put None into opt display_option(&mut opt); // Will indicate that there is nothing in the opt
} Of course we could have used core::mem::swap() as well, but Option::take() is more idiomatic. Here is a version with swap() anyway: fn display_option(opt: &mut Option<&str>) { let mut empty = None; core::mem::swap(&mut empty, opt); // What was referenced by `opt` is now in `empty` // and what was in `empty` is now referenced by `opt`. // Let's check it with an `assert!()`. assert!(opt.is_none()); if let Some(s) = empty { // `empty` now contains what was in `opt` println!("I have taken ownership of the string, which was: {s}"); } else { println!("There was nothing in the opt"); }
} fn main() { let mut opt = Some("Hello, world"); display_option(&mut opt); // Will display the string and put None into opt display_option(&mut opt); // Will indicate that there is nothing in the opt
} There also exists Option::replace() which takes the content of an Option<T> we have a reference onto and replaces it with Some value.
